import React from 'react';
import { Link } from 'react-router-dom';
import '../Auth/auth.css'; // Directly using auth.css


const Landing = () => {
    return (
        <div className="auth-container"> {/* Reusing login/signup container styles */}
            <h1>Welcome to Hungry Hault</h1>
            <p>Your go-to place for delicious meals and seamless online ordering.</p>
            <div className="auth-buttons">
                <Link to="/login" className="auth-button">Login</Link>
                <Link to="/register" className="auth-button">Sign Up</Link>
            </div>
        </div>
    );
}

export default Landing;
